import React, { useState, useEffect } from  'react';
import axios from 'axios';
import { Navigate } from 'react-router-dom';
import { makeStyles } from '@mui/styles';
import { Typography, Button, Grid, TextField } from '@mui/material'

import DisplayAppBar from './DisplayAppBar';

export default function HomePage() {
    const [data, setData] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:8000/check-login-status/", {withCredentials: true})
        .then(response => {
            console.log(response.data);
        })
        .catch(error => {
            console.log(error);
            // return <Navigate to="/" />;
        })
        axios.get("http://localhost:8000/swimmer/", {withCredentials: true})
        .then(response => {
            console.log(response.data)
            setData(response.data);
        })
        .catch(error => {
            console.log(error);
        })
    }, []);

    const handleLogout = async (e) => {
        e.preventDefault();
        try {
            axios.post('http://localhost:8000/logout/', {}, {withCredentials: true})
            .then((response) => {
                console.log(response);
                return <Navigate to="/" />;
            }).catch(error => {
                console.error(error);
            });
        } catch (error) {
            console.error(error);
        }
    }

    return (
        <div>
            <Grid container>
                {data.map((item, index) => (
                    <Grid container>
                        <Typography variant="h6" >{item.fname}</Typography>
                        <Typography variant="h6" >{item.lname}</Typography>
                        <Typography variant="h6" >{item.email}</Typography>
                        <Typography variant="h6" >{item.club}</Typography>
                    </Grid>
                ))};
            </Grid>
            <Button variant="outlined" onClick={handleLogout}>Log Out</Button>
        </div>
    )
};
